    "Sex steroid hormones in barn swallow (Hirundo rustica) populations at a dioxin
    contaminated site in northeast Louisiana",nt"tracking_summary": {ntt"total":
    96,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:21.141360",nt"name": "sex-steroid-hormones-in-barn-swallow-hirundo-rustica-populations-at-a-dioxin-contaminated-",nt"isopen":
    false,nt"url": null,nt"notes": "This study compares the gonadal sex steroid
    hormone levels (i.e., estradiol, total estrogen, and testosterone) in Louisiana
    barn swallows (Hirundo rustica) that were collected during 1994-95 breeding season
    at a dioxin-contaminated wetland, i.e., Wham Brake, to two reference populations,
    i.e., Bayous Bartholomew and De Siard. Sediments, barn swallows, and their nests
    were analyzed for various dioxin/dibenzofuran congeners in an attempt to relate
    anomalies in hormone levels to those contaminants. The dioxin concentrations detected
    in all media at Wham Brake were elevated above those observed at the two reference
    sites. Generally, hormone levels in both males and females were higher in Wham Brake
    barn swallows relative to those observed at the reference sites. Hormone ratios
    (i.e., estradiol:testosterone and total estrogen:testosterone) were all comparable
    and, thus, were unremarkable. It is noteworthy, however, that Wham Brake total estrogen
    levels in both females and males and the testosterone levels in males were significantly
    greater than that observed at the reference sites. A comparable situation appears
    to exist for testosterone levels in Wham Brake females, the levels of which approached
    significance.",nt"license_title": "License Not Specified",nt"extras":
